column9:
Número do processo trabalhista, da ata ou número de identificação da conciliação.
Validação: a) Se o evento de origem for S-2501, retornar o campo nrProcTrab desse evento;
b) Se o evento de origem for S-3500, retornar o campo nrProcTrab do evento S-2501 objeto da exclusão.

Mês/ano em que é devida a obrigação de pagar a parcela prevista no acordo/sentença.
Validação: a) Se o evento de origem for S-2501, retornar o campo perApurPgto desse evento;
b) Se o evento de origem for S-3500, retornar o campo perApurPgto do evento S-2501 objeto da exclusão.

Informar o mês/ano (formato AAAA-MM) de referência das informações.
Validação: a) Se o evento de origem for S-2501, retornar o campo perRef desse evento;
b) Se o evento de origem for S-3500, retornar o campo perRef do evento S-2501 objeto da exclusão.
